import React, { useEffect, useState } from "react";
import './../CallendarCard.css';

const CallendarCard = ({day, events}) => {
    return(
        <div class="callendar-card">
            <p>dzien: {day} <br />
            {events.map(event => (
                <>{event.name}</>
            ))}
            </p>
        </div>
    )
}

export default CallendarCard;
